#create a set using myset = set() and myset2 = {} and see the difference between both approaches

myset = set('ATGTGGG')
print(myset)
#returns the output {'T', 'G', 'A'}, notice only unqie values in curly brackets
#a set is an ordered collection of data with no dplicate elements


myset2 = {'ATGCCT'}
print(myset2)
#retuns {'ATGCCT'}, notice it is as is without removing duplicates.
#this creates a list


#crete the intersection, difference, union and symmetrical differnece between 2 sets

A = set('3 14 15 9 26 5 35 9')
B = set('60 22 14 0 9')
print(A & B) #intersection
print(A - B) #difference
print(A | B) #union
print(A ^ B) #symmetrical difference

#create a set using dna seq and see the output

dna = set('')
print(dna)

dna = ''
#create a new empty dictionary
nt_count = {}
print(dna)
print(len(dna))
unique = set(dna)
print('unique nt:', unique) #prints unique nt in dna set

#iterate through each unique character and count the number found in the sequence

for nt in unique:
	count = dna.count(nt) #count the number of this unique nt in dna
	
	nt_count[nt] = count
print('nt_count:', nt_count)















